import { CAMPSITES } from '../../app/shared/CAMPSITES';

export const selectedAllCampsites = () => {
    return CAMPSITES;
};

export const selectRandomCampsites = () => {
    return CAMPSITES[Math.floor(Math.random * CAMPSITES.length)];
};
